import jQuery from 'jquery'
global.jQuery = jQuery;
global.$ = jQuery;


import Vue from 'vue'
import VueRouter from 'vue-router'

import App from './App.vue'
import Pedigree from './components/pages/Pedigree.vue'

Vue.use(VueRouter);

const routes = [
  {
    path: '/',
    component: Pedigree,
  }
]

const router = new VueRouter({
  routes
})

new Vue({
  el: '#app',
  render: h => h(App),
  router
})
